const add = function (num1, num2) {
  return num1 + num2;
};

const subtract = function (num1, num2) {
  return num1 - num2;
};

const sum = function (arr) {
  return arr.reduce(sum, arr), 0;
};

const multiply = function (num1, num2) {
  return num1 * num2;
};

const power = function (num1, num2) {
  return num1 ** num2;
};

